member.summary:
            The Amadeus API client. To initialize, use the builder as follows:

To initialize, use the builder as follows:

            Amadeus amadeus = Amadeus.builder("REPLACE_BY_YOUR_API_KEY", "REPLACE_BY_YOUR_API_SECRET").build();


Or pass in environment variables directly:

            System.Environment.SetEnvironmentVariable("AMADEUS_CLIENT_ID", "REPLACE_BY_YOUR_API_KEY");
            System.Environment.SetEnvironmentVariable("AMADEUS_CLIENT_SECRET", "REPLACE_BY_YOUR_API_SECRET");
            Amadeus.builder().build();


            Booking



            A namespaced client for the
            /v2/booking endpoints.



Access via the Amadeus client object.


            Amadeus amadeus = Amadeus.builder("clientId", "secret").build();
            amadeus.booking;


            DutyOfCare



            A namespaced client for the
            /v1/duty-of-care endpoints.



Access via the Amadeus client object.


            Amadeus amadeus = Amadeus.builder("clientId", "secret").build();
            amadeus.dutyOfCare;


            Diseases



            A namespaced client for the
            /v1/duty-of-care/diseases endpoints.



Access via the Amadeus client object.


            Amadeus amadeus = Amadeus.builder("clientId", "secret").build();
            amadeus.dutyOfCare.diseases;

Adds another key/value pair to the Params map. Automatically
converts all values to strings.

amadeus.get("/foo/bar", Params.with("first_name", "John").and("last_name", "Smith"));


